import React, {Component} from 'react';
import EventList from './EventList/EventList';
import SearchResults from './SearchContainer/SearchContainer'

class EventfulContainer extends Component {
    constructor(){
        super();
        this.state = {
            events: []
        }
    }

    getEvents = async () => {
        try {
            const events = await fetch('https://api.songkick.com/api/3.0/metro_areas/24580/calendar.json?apikey=STzlRsvfup7hHr4s')

            const eventsJSON = await events.json();
            console.log(eventsJSON.resultsPage)
            return eventsJSON

        } catch (err) {
            return err
        }
    }

    componentDidMount () {
        this.getEvents().then((events) => {
            console.log(events.resultsPage)
          this.setState({events: events.resultsPage.results.event});
          console.log('hey')
        }).catch((err) => { 
          console.log(err)
        })
      }

      performSearch = async (searchTerm) => {

            try {
                const events = await fetch('https://api.songkick.com/api/3.0/search/locations.json?query='+ searchTerm +' &apikey=STzlRsvfup7hHr4s')


                const eventsJSON = await events.json();
                console.log(eventsJSON.resultsPage)
                return eventsJSON

            } catch (err) {
                return err
            }


      }




    render() {
        return(
            <div>
                <SearchResults />
                <EventList events= {this.state.events}/> 
            </div>
        )
    }
}

export default EventfulContainer;
